import User from './User'

const UserList = ({users, onClickUserEdit, onFormSubmit, editUserSubmitHandler, addUserFormSubmitHandler}) => {
    return (
        <>
            {users.map(
                (user) => <User 
                            key={user.id} 
                            user={user} 
                            onClickUserEdit = {onClickUserEdit}
                            onFormSubmit = {onFormSubmit}
                            editUserSubmitHandler = {editUserSubmitHandler} 
                            addUserFormSubmitHandler = {addUserFormSubmitHandler} />
            )}
        </>
    )
}

export default UserList
